3','dc2817d0-3e6d-47d2-bbbd-bc38db910916','c7968a30-a0e5-4208-b422-dd75049f441b','AZKZX','da70f7ad-f3fb-40db-8d8b-054e9cac0780'),('18920c43-1edf-4928-8b1d-88b20fe133dd','厦门友好妇科医院','2013-04-26',NULL,'1.无菌物品（未使用的）下送车放在病人入口处。\r\n2.灭菌后器械有污迹。\r\n3.手术器械在手术室内初洗。\r\n4.麻醉螺纹管未能一人一用一清洗。\r\n\r\n','','4','fb32c9cd-1847-458a-8daf-4b5bd7f34b4c','c7968a30-a0e5-4208-b422-dd75049f441b','AZKZX','348609fe-ca41-4f4e-9f12-9b506cc0f608'),('b2bea26f-6080-4d93-8b2a-53634942da86','厦门友好妇科医院','2013-04-26',NULL,'麻醉单无剖宫产抗菌药物使用记录。\r\n','','1','bba35c52-60d2-4146-85b3-1eb319720c9f','c7968a30-a0e5-4208-b422-dd75049f441b','AZKZX','2af430a2-14a1-4d5e-8d9a-168609e506d7'),('f9c01620-03cf-4a99-b919-f501129da4f3','厦门同安城南医院','2013-04-25',NULL,'无手术室各项规章制度\n','','10','3db888be-370e-4e55-be89-64b89173b8fd','c7968a30-a0e5-4208-b422-dd75049f441b','AZKZX','058cdb9c-30ce-42d0-8132-fab97b5b87d4'),('21be000f-1c8c-4823-8482-faf20a86f468','厦门同安城南医院','2013-04-25',NULL,'1.分区不明确人、物流洁污有交叉。因装修，暂停手术，已在市监督所备案；\n2.无菌手术间、一般手术间、隔离手术间无标识，所有手术只在一个手术室进行。\n\n','','2','a3fd698c-4107-4864-bd70-accbfc2ce0df','c7968a30-a0e5-4208-b422-dd75049f441b','AZKZX','11fae692-9bfc-46ba-a344-5cdab6cabf97'),('746233b7-ea2d-4a78-94d4-718158529fe7','厦门同安城南医院','2013-04-25',NULL,'无外科洗手用手消毒液，使用木背刷，无干手设施。\n','','1','dc2817d0-3e6d-47d2-bbbd-bc38db910916','c7968a30-a0e5-4208-b422-dd75049f441b','AZKZX','da70f7ad-f3fb-40db-8d8b-054e9cac0780'),('632faed3-a79b-41f6-956c-82e6c3ac98a9','厦门同安城南医院','2013-04-25',NULL,'1.手术间无菌柜内存放无菌物品和非无菌物品；\n2.器械用2%戊二醛浸泡，未注明浸泡起止时间和消毒剂名称，器械未完全打开及未完全浸泡消毒液，存放容器生锈，建议其器械采用高压蒸汽灭菌及使用不锈钢容器。\n\n','','4','fb32c9cd-1847-458a-8daf-4b5bd7f34b4c','c7968a30-a0e5-4208-b422-dd75049f441b','AZKZX','348609fe-ca41-4f4e-9f12-9b506cc0f608'),('9334f593-d9e1-41b2-931e-73b3d2a8e323','西坂医院','2013-04-25',NULL,'除设备管理制度外，其他制度均无。\r\n','','9','3db888be-370e-4e55-be89-64b89173b8fd','c7968a30-a0e5-4208-b422-dd75049f441b','AZKZX','058cdb9c-30ce-42d0-8132-fab97b5b87d4'),('282f77d5-e770-492d-98ea-dd380c715a36','西坂医院','2013-04-25',NULL,'1.门未保持关闭状态。\r\n2.手术室未设标识，所有手术均